import './App.css';
import NavBar from './NavBar'
import Home from './Home'
import { HashRouter as Router, Route } from 'react-router-dom'

function App() {
  return (
    <Router>
      <NavBar />
      <Routes>
      <Route exact path="/">
          <Home />
        </Route>
      </Routes>

    </Router>
  );
}

export default App;
